import React, { Component } from 'react'
import { Card } from 'antd';
 
function Coursesps(props){
    return(
        <div>
            <Card className="card1" bordered={true} style={{ width: 300 } }>
                <div>
                    Course
                    <form >
                        <label>
                            Course Grade
                        </label>
                        <input type="select" />
                    </form>
                </div>
            </Card>
        </div>
    );
}
export default Coursesps
